import React from "react";

const SlideFirst = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-6">
            <img
              className="testinomial-section-img"
              src="assest/photos/1.jpg"
            />
          </div>
          <div className="col-6">
            There are two types of people who will tell you that you cannot make
            a difference in this world: those who are afraid to try and those
            who are afraid you will succeed.
          </div>
        </div>
      </div>
    </>
  );
};

export default SlideFirst;
